# Generated by re2py
# re2py $INPUT -o $OUTPUT

def lex(str):
    cur = 0
    
    yystate = 0
    while True:
        match yystate:
            case 0:
                yych = str[cur]
                cur += 1
                match yych:
                    case 0x31|0x32|0x33|0x34|0x35|0x36|0x37|0x38|0x39:
                        yystate = 2
                        continue
                    case _:
                        yystate = 1
                        continue
            case 1:
                return False
            case 2:
                yych = str[cur]
                match yych:
                    case 0x30|0x31|0x32|0x33|0x34|0x35|0x36|0x37|0x38|0x39:
                        cur += 1
                        yystate = 2
                        continue
                    case _:
                        yystate = 3
                        continue
            case 3:
                return True
            case _:
                raise "internal lexer error"


assert lex(b"1234\0")
